import React, { useEffect } from 'react';
import '../src/Contact.css';
import Typed from 'typed.js';

function Contact() {
    const el = React.useRef(null);

    useEffect(() => {
        const typed = new Typed(el.current, {
            // strings: ["greetingLanguage"],
            // typeSpeed: 50,
            // backSpeed: 50,
            // loop: true,
            // backDelay: 1000,
            // cursorChar: '_',
            // autoInsertCss: false,
            strings: ["Software Engineer", "Web Developer", "Full Stack Developer", "Backend Developer"],
            typeSpeed: 0,
            backSpeed: 0,
            cursorChar: '_',
            shuffle: true,
            smartBackspace: false,
            loop: true
        });
        return () => {
            typed.destroy();
        }
    }, []);


    return (
        <>
            <div className='contactSection d-flex flex-column align-items-center justify-content-center'>
                <p className="fs-1" style={{ opacity: "80%" }}>Get in touch</p>
                <p className='fs-5'>Like what you see? Free feel to contact me or even just say hi! I'm open to: </p>
                <div>
                    <span ref={el} />
                </div>


            </div>
        </>
    );
}

export default Contact;
